() => {

		var children = []
		var now = moment().format()

		for (let i = 0; i < GetWarehouseBins.data.data.getEquipment.children.length; i++) {

			var current = GetWarehouseBins.data.data.getEquipment.children[i]

			let equipment = {
				"id": current.id
			}

			let line = {
				"workType": "Inventory",
				"name": "stocktake_" + GetWarehouseBins.data.data.getEquipment.name + "_" + current.name + "_" + moment().date() + "/" + moment().month() + "/" + moment().year(),
				"createdDateTime": now,
				"equipment": equipment,
				"dispatchStatus": "ACTIVE"
			}
			children.push(line)

		}
		let equipment = {
				"id": GetWarehouseBins.data.data.getEquipment.id
			}

		let ret = {
			"workType": "Inventory",
			"name": "stocktake_" + GetWarehouseBins.data.data.getEquipment.name + "_" + moment().date() + "/" + moment().month() + "/" + moment().year(),
			"createdDateTime": now,
			"equipment": equipment,
			"dispatchStatus": "ACTIVE",
			"children": children
		}
		return ret
	}

